function rain() {
    weather.send("TEST", "rain");
  }

  function wind() {
    weather.send("TEST", "wind");
  }

  function day() {
    weather.send("TEST", "day");
  }

function UnityWeatherApp() {
    return (
        <div>
            <Button label="Wind" onClick={wind} className="p-m-1"/>
            <Button label="Rain" onClick={rain} className="p-m-1" />
            <Button label="Day/Night" onClick={day} className="p-m-1" />
        </div>
    )
}

export default UnityWeatherApp
